import React from "react";
import { ReactDOM } from "react-dom";
import { Route, Routes } from 'react-router-dom';
import { BrowserRouter } from 'react-router-dom';

//Styles
import style from '../styles/managerPage/table.css';

//Component

import { Header } from "../managerComponents/Header";
import { Background } from "../managerComponents/Background";
import { Central } from "../managerComponents/Central";
import { Table } from "./Table";

function ManagerPage(){
    return(
        <React.Fragment>


                <Header />

                <Background />

                <Routes>

                    <Route path="/" element={<Central />} />

                </Routes>


        </React.Fragment>
    );
}


export {ManagerPage};
